- input: "TEXT\x1CC00028860\x1C.TEXT\x1C\x1CF3XN\x1CWe do not have any individual
    contributors over $200 to report at this time. In addition, we continue to experience
    technical difficulties with the newest version of the software, 6.1.1.3.  After
    several conversations with tech support they are still unable to determine what
    the problem is or how to fix it. We are receiving warnings about our committee
    ID's being missing, although they are there. Tech support mailed me a CD version
    of the software, but we am still experiencing the same problems. When we emailed
    tech support the file they said that everything looks fine to them and they do
    not get the same error messages that we do. Hopefully all of our information is
    transmitting properly even if it doesn't show at our end."
